<!DOCTYPE html>
<html>

  <head>
    <style type="text/css">
      body {
        background-color: steelblue;
        background-image: url("https://www.transparenttextures.com/patterns/dark-denim-3.png");
        overflow: hidden;
      }
      svg {
        width: 100%;
        height: 98vh;
        z-index: 100;
      }
      svg *, .content {
        transition: fill .6s ease-out, opacity .6s ease-out;
      }
      .topCircle {
        opacity: 0;
      }
      .content {
        opacity: 0;
        position: absolute;
        min-height: 100%;
        min-width: 100%;
        top: 0;
        right: 0;
        bottom: 0;
        left: 0;
        min-width: 100%;
        border: none;
        -webkit-border-radius: 50% / 10%;
        border-radius: 50% / 10%;
        z-index: -1;
      }
      .content video {
        display: block;
        background: black;
        position: fixed;
        top: 50%;
        left: 50%;
        z-index: -1;
        min-width: 100%;
        min-height: 100%;
        width: auto;
        height: auto;
        transform: translate(-50%, -50%);
      }
      .content:before {
        content: '';
        position: absolute;
        background-image: url(https://www.transparenttextures.com/patterns/white-linen.png);
        background-size: auto;
        background-repeat: repeat;
        background-blend-mode: exclusion;
        border: none;
        -webkit-border-radius: 5% / 50%;
        border-radius: 5% / 50%;
        min-height: 100%;
        min-width: 100%;
        top: 0;
        right: 0;
        bottom: 0;
        left: 0;
      }
      @media all and (min-width: 600px) {
        .content {
          opacity: 1;
        }
        .topCircle {
          opacity: 0;
          stroke: black;
          stroke-width: 3px;
        }
      }
      @media all and (max-width: 600px) {
        .topCircle {
          opacity: 1;
          fill: url(#foom-embed);
          stroke: black;
          stroke-width: 3px;
        }
      }
      @media all and (max-width: 400px) {
        .topCircle {
          opacity: 0;
        }
        #circleRed {
          fill: red;
        }
        #circleWhite, #outline, #yellows {
          opacity: 0;
        }
      }
      @media all and (max-width: 350px) {
        #helmetAll, #circleRed {
          opacity: 0;
        }
        #bannerBlue {
          stroke: black;
          stroke-width: 3px;
        }
      }
      @media all and (max-width: 300px) {
        #foomWhite {
          fill: yellow;
        }
        #foomLine {
          stroke: black;
          stroke-width: 4px;
        }
        #helmetAll, #bannerBlue, #bannerBack {
          opacity: 0;
        }
      }
      @media all and (max-width: 200px) {
        #foomWhite {
          fill: black;
        }
        #foomLine {
          opacity: 0;
        }
      }

    </style>
  </head>
